import Link from "next/link";
import styles from "./SideBarNav.module.css";

const SideBarNav = () => (
  <nav className="navbar .flex-column">
    <div className={styles.container}>
      <a className="navbar-brand">Brand</a>
      <Link href="/">
        <a>Home</a>
      </Link>
      <Link href="/search">
        <a>Search</a>
      </Link>
    </div>
  </nav>
);

export default SideBarNav;
